import React from 'react'


export const OpcionesDd = (props) =>{
	const JSX = []
	const ManejadorJSX = () =>{
		for(let i ;  i < props.NumItems ; i++ ){
			JSX.push(<li className="nav-item"><a className="nav-link" href="#">{props.NameItems[i]}</a></li>)
		}
		return JSX[1]
	}

	return(
		<li className="nav-item submenu dropdown">
			<a href="#" className="nav-link dropdown-toggle" data-toggle="dropdown" role="button" aria-haspopup="true" aria-expanded="false">{props.Title}</a>
			<ul className="dropdown-menu">
				{ManejadorJSX()}
			</ul>
		</li>
	)
}
